# https://leetcode.com/problems/online-election/editorial/?envType=problem-list-v2&envId=array
class TopVotedCandidate:

    def __init__(self, persons: List[int], times: List[int]):
        self.heaps = []
        h = []
        votes = defaultdict(int)
        leader, m = None, 0
        for pi, ti in zip(persons, times):
            votes[pi] += 1
            c = votes[pi]
            if c >= m:
                if pi != leader:
                    leader = pi
                    self.heaps.append((ti, leader))
                m = c

    def q(self, t: int) -> int:
        # m = bisect_left(self.heaps, (t+1, math.inf))-1
        # return self.heaps[m][1]
        i = bisect.bisect(self.heaps, (t, float('inf')), 1)
        return self.heaps[i-1][1]

